import React from 'react'

class Shop extends React.Component {

   createButtons(){
      const buttons = [];
      for(let i = 0; i < 5; i++){
         buttons.push('<button>kecske<button/>');
      }
      return buttons;
   }

   render(){
      return (
         <div className="buttons">
            {this.createButtons()}
         </div>
      )
   }

}

export default Shop
